function parseQueue(queue: Song[]| null): TrackInfo[] {
    if(queue!=null){
    return queue.map((song) => {
        return {
            trackName: song.name,
            artistName: song.artist,
            time: 0,
            src: song.url,
            id: song.id
        };
    });
    }
    return []
}
