function App() {
    const dispatch = useDispatch()
    const [queue, setQueue] = useState<Song[] | null>(null);
    const [query, setQuery] = useState('');
    //const [isLoading, setIsLoading] = useState<boolean>(true);
    useEffect(() => {
        setQueue(q);
        dispatch(actions.setLibrary(parseQueue(queue)));

    }, [queue]);

useEffect(() => {

    const confirmationMessage = 'Are you sure you want to leave? All your changes will be lost.';

    const handleBeforeUnload = (event: BeforeUnloadEvent) => {
        event.preventDefault();
        event.returnValue = confirmationMessage;
        return confirmationMessage;
    };

    window.addEventListener('beforeunload', handleBeforeUnload);

    return () => {
        window.removeEventListener('beforeunload', handleBeforeUnload);
    };

}, []);

const favoriteTracks = useTypedSelector(state=> state.tracksInfo)
const libary = useTypedSelector(state=>state.libaryTracks)
    const [currentTracks, setCurrentTracks] = useState<TrackInfo[]>(libary);
    const [watchFavorites, setWatchFavorites] = useState(true);
    const handleChange = (event: ChangeEvent<HTMLInputElement>) => {
        setQuery(event.target.value);
    };

    const handleSubmit = (event: FormEvent<HTMLFormElement>) => {
        event.preventDefault();
        //onSearch(query);
    };
    const changeCurrentTracks = (flag:boolean | undefined=false)=>{
        if(flag)
            return
        if(watchFavorites){
            setCurrentTracks(favoriteTracks)
            setWatchFavorites(false)
        }
        else {
            setCurrentTracks(libary)
            setWatchFavorites(true)
        }
    }
//(isLoading)
    //return (<>Загрузка...</>)
return (
    <div className={styles.playerContainer}>
        <div className={styles.additionalControls}>
            <form onSubmit={handleSubmit} className={styles.formContainer}>
                <input
                    type="text"
                    placeholder="Поиск..."
                    value={query}
                    onChange={handleChange}
                    className={styles.inputField}
                />
                <button type="submit">Добавить</button>
            </form>
            <button onClick={()=>{changeCurrentTracks(false)}} className={styles.favoriteButton}
                    data-count={watchFavorites? favoriteTracks.length: libary.length}>{watchFavorites ? 'Смотреть избранное' : 'Смотреть очередь'}</button>
        </div>
        <div className={styles.trackBlocksContainer}>
            {currentTracks != null ?
                currentTracks.map((t) => (
                    <TrackBlock track={t} key={t.id} changeCurrentTracks={changeCurrentTracks} currentFlag={watchFavorites}/>
                )) : null}
        </div>
        <div className={styles.trackBarContainer}>
            <TrackBar/>
        </div>
    </div>

)
}

export default App
